import React from 'react';
import { BrowserRouter as Router,Route} from 'react-router';
import Home from './Home';

class App extends React.Component {
    render(){
        return(
            <Router >
                <div>
                    <Route path="/" component={Home} />
                </div>
            </Router>
            )
        }
    }

export default App;
